import React from 'react';
import ReactDOM from 'react-dom';
import AppRouter from './AppRouter';
// import 'antd/dist/antd.css'; // 引入Ant Design的样式
import './index.css'; // 引入自定义的样式

ReactDOM.render(
    <React.StrictMode>
        <AppRouter />
    </React.StrictMode>,
    document.getElementById('root')
);
